]

const Type = () => {
    return (
        <>
          <section className={`${classes.featured} ${classes.background}`}>
            <div className={classes.container}>
              <Heading title='Featured Property Types' subtitle='Find All Type of Property.' />
              <div className={`${content} ${grid5} ${mtop}`}>
                {typeData.map((items, index) => <TypeCard item={items} index={index} />)}
            </div>
            </div>
          </section>
        </>
    )
}

export default Type
